import React from "react";
import { Grid } from "@material-ui/core";
import { RootStateOrAny, useSelector, useDispatch } from "react-redux";

function FilterModeArrowx({
  clickSlideprev,
  clickSlidenext,
  tfilterHeightey,
  itemCLICKED,
  total,
  filterHeight,
  fullHeight,
}: any): JSX.Element {
  ///
  ///
  ///
  /// INTERFACE/TYPES FOR SCREENHEIGHT AND DARKMODE
  interface RootStateGlobalReducer {
    GlobalReducer: {
      darkmode: boolean;
    };
  }

  ///
  ///
  ///
  /// GET SCREENHEIGHT FROM REDUX STORE
  const { darkmode } = useSelector((state: RootStateGlobalReducer) => ({
    ...state.GlobalReducer,
  }));

  const darkmodeReducer = darkmode;

  return (
    <>
      <Grid
        container
        style={{
          position: "absolute",
          marginTop: `${fullHeight - filterHeight / 2}px`,
          zIndex: 2,
          height: "0px",
          width: "100%",
          padding: "0px",
        }}
      >
        <Grid
          item
          onClick={clickSlideprev}
          className={
            darkmodeReducer
              ? "slider-arrow-backpad-leftDARK"
              : "slider-arrow-backpad-leftLIGHT"
          }
          style={{
            height: `${filterHeight}px`,
            cursor: "pointer",
            backgroundColor: "#00ccff",
          }}
          xs={2}
        >
          {" "}
        </Grid>{" "}
        <Grid item style={{ height: "0px" }} xs={8}>
          {" "}
        </Grid>{" "}
        <Grid
          item
          onClick={clickSlidenext}
          className={
            darkmodeReducer
              ? "slider-arrow-backpad-rightDARK"
              : "slider-arrow-backpad-rightLIGHT"
          }
          style={{
            height: `${filterHeight}px`,
            cursor: "pointer",
          }}
          xs={2}
        >
          {" "}
        </Grid>
      </Grid>
    </>
  );
}

export const FilterModeArrow = React.memo(FilterModeArrowx);
